export const toKeyPair = async (keypair: any) => {
  return {
    '@context': [
      'https://w3c-ccg.github.io/universal-wallet-interop-spec/contexts/wallet-v1.json',
    ],
    ...keypair,
    name: 'Sidetree KeyPair',
    image:
      'data:image/png;base64,',
    description: 'Generated by @sidetree/wallet.',
    tags: [],
  };
};
